My Pregnancy is a week-by-week pregnancy tracker. Our app will help you over the course of your pregnancy. Stay on top of the changes happening inside your body. Find out how your baby is developing.

Our app is completely free and does not contain advertising.

This app includes:
- week-by-week advice;
- useful information on fetal development and changes in your body;
- week-by-week fetal measurements and imaging;
- a to-do list for each trimester;
- a list of things you will need for hospital check-in, post-natal care and check-out;
- a weight tracker you can use to follow weight gain;
- a kick counter;
- a contraction timer;
- and much more

We have created this app with love, specially for young mothers.

This app is not intended for medical use and is not a substitute for medical consultation.

If you have any questions or requests, please write to neumandev@gmail.com. We are eager to hear your comments on how to improve the app.

Care4Today is your personalised care companion and communication tool. Care4Today will connect, educate and support you throughout your treatment journey .

You will have access to: 
- Determine where you currently are in your treatment pathway, and what to expect as next steps;
- Reminders and notifications;
- Educational materials to read and videos specific to your care;
- Useful checklists and frequently asked questions;
- Know your healthcare team and who to contact with questions and concerns;
- Information about your care provider's facilities & parking.

- Care4Today does not qualify as a medical device per applicable regulations, including the EU Medical Device Regulation No 2017/745.
- Care4Today does not perform an action on data different from storage, archival, communication or simple search.
- Care4Today is not intended for patient diagnosis or treatment. Healthcare professionals only are responsible for taking decisions related to patient diagnosis or treatment.
- If you have any questions related to their state of your health at any point in your treatment, you should contact your healthcare provider directly.

